import React from 'react';
import styled from 'styled-components';
import Rectangle from '../common/Rectangle';

const Wrapper = styled.section`
  border: 1.5px solid #FEA82F;
  border-radius: 10px;

  .qwer {
    display: flex;
    
  }

  .asdf {
    margin: 35px 70px 35px 70px;
    display: flex;
    flex-direction: column;
  }

  .asdfgh {
    font-family: Roboto;
  font-style: normal;
  font-weight: bold;
  font-size: 24px;
  line-height: 36px;
  }

    .asdf > p { /* 자식 p태그 */
      font-family: Roboto;
      font-style: normal;
      font-weight: bold;
      font-size: 20px;
      line-height: 36px;
    }

  .ghjk {
    display: flex;
  }

  .sdfg {
    display: inline-block;

    width: 60px;
    height: 60px;

    border: 1px solid #C4C4C4;
    box-sizing: border-box;
    border-radius: 5px;
  }

  .zxcv {
    margin: 12px;
    width: 32px;
    height: 32px;
  }
`;



const Summary = (props) => {
  return <>
  <Wrapper>
    <div className="qwer">
      <img src="assets/images/summary.png" alt="img" />
      <div className="asdf">
        <h2 className="asdfgh">독서모임 이름</h2>
        <p>독서모임 인원</p>
        <p>독서모임 일정</p>
        <p>독서모임 주제</p>
        <div className="ghjk">
          <div className="sdfg">
            <img className="zxcv" src="assets/images/icons/heart.png" alt="icon" />
          </div>
            <Rectangle>참여</Rectangle>
        </div>
      </div>
    </div>
  </Wrapper>
    
  </>;
};

export default Summary;
